import React from "react";
import './Menu.css'

const Navbar = () => {
    return (
        <div className="navbar">
            <img src="" alt="" className="logo"/>
            <ul>
                <li>Home</li>
                <li>Products</li>
                <li>About</li>
            </ul>
        </div>
    )
}

export default Menu;
